import React from 'react'
import { Link } from 'react-router-dom';
import '../App.css'

const Header = () => {
  return (
    <Button
        variant="contained"
        color="secondary"
        className={classes.button}
        startIcon={<DeleteIcon />}
      >
        Delete
      </Button>
  )
}

export default Header
